    false,nt"url": null,nt"notes": "Watershed Sciences, Inc. (WSI) collected
    Light Detection and Ranging (LiDAR) data on the Quinault watershed survey area for
    the Puget Sound LiDAR Consortium. This data set covers approximately 181 square
    miles. Due to spring snow on the ground WSI was unable to acquire data for the complete
    survey during the initial flights in April and will return to finish acquisition
    at a later date. Delivery 1 of the survey area was collected on March 24th and 25th
    and April 8th and 9th and 22nd. The LiDAR survey utilized both a Leica ALS60 and
    a Leica ALS50-II sensor in a Cessna Caravan 208B.All areas were surveyed with an
    opposing flight line side-lap of =60% (=100% overlap) to reduce laser shadowing
    and increase surface laser painting. The Leica laser systems allow up to four range
    measurements (returns) per pulse, and all discernible laser returns were processed
    for the output dataset. This LiDAR survey achieved a nominal point spacing of 9.23
    points per square meter.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
